import React from 'react';
import "./Feed.css";
import StoryReal from "./StoryReal";
import PostSection from "./PostSection";
import Post from "./Post";


function Feed() {
    return (
        <div className="feed">
            <StoryReal/>
            <PostSection/>

            <Post
            profilesrc="https://mymodernmet.com/wp/wp-content/uploads/2019/05/Big-Picture-Natural-World-Photo-Contest-thumbnail.jpg"
            message="this works"
            timestamp="this is a timestamp"
            username="fegohuncho"
            image="https://hips.hearstapps.com/rbk.h-cdn.co/assets/17/33/1502810299-gettyimages-681831352-1.jpg?crop=1.00xw:0.750xh;0,0.250xh&resize=1200:*"
            />

            <Post
            profilesrc="https://mymodernmet.com/wp/wp-content/uploads/2019/05/Big-Picture-Natural-World-Photo-Contest-thumbnail.jpg"
            message="this works"
            timestamp="this is a timestamp"
            username="fegohuncho"
            image=""
            />

            <Post
            profilesrc="https://mymodernmet.com/wp/wp-content/uploads/2019/05/Big-Picture-Natural-World-Photo-Contest-thumbnail.jpg"
            message="this works"
            timestamp="this is a timestamp"
            username="user"
            image="https://66.media.tumblr.com/45507084f6aeb77b76426b5f29fc707c/tumblr_p3hgo73jza1s0cfqro1_500.jpg"
            />




        </div>
    );
}

export default Feed;
